	function CheckForMeHardhat(u) {

		return function() {
			var i;
			//console.log("hardhats CheckForMeHardhat");
			setTimeout(CheckForMeHardhat('pageload'), 750);
			if (Waze.model.loginManager.isLoggedIn()) {
				var UserName = Waze.model.loginManager.user.userName; //editors user name
				var UserID = Waze.loginManager.getLoggedInUser().id; //editor's id number
				var UserLevel = W.model.users.objects[UserID].rank + 1; //editor's rank

				//testing bits
				//UserName = "Bigbear3764";
				//UserLevel = 6;

				var OnSpecialHatsList = false;

				//change special hats editors
				for (i = 0; i < SpecialHatsList.length; i++) {
					if (SpecialHatsList[i] === UserName) {
						//$('.olLayerDiv .olAlphaImg').addClass('hat-HardHat' + SpecialHatsList[i] + '');		
						$('.olLayerDiv .olAlphaImg').attr('src', eval('HardHat' + UserName));
						// $('.side-panel-section .rank').addClass('hat-HardHat' + SpecialHatsList[i] + '');
						$('#user-info .level-icon').addClass('hat-HardHat' + SpecialHatsList[i] + '');
											
						//user-profile

						$('#user-info .level-icon').css("width", "50px");
						$('#user-info .level-icon').css("height", "42px");

						//height 42px width 50px
						OnSpecialHatsList = true;
						//UserLevel=0;
					}
				}

				if (OnSpecialHatsList === false) {
					//change to the normal editors hardhat colors
					if (UserLevel >= 6 && $('.olLayerDiv .olAlphaImg').hasClass('hat-HardHatRed') === false) {
						//$('.olLayerDiv .olAlphaImg').addClass('hat-HardHatRed');
						$('.olLayerDiv .olAlphaImg').attr('src', HardHatRed);
						$('.side-panel-section .rank').addClass('hat-HardHatRed');
					} else if (UserLevel === 5 && $('.olLayerDiv .olAlphaImg').hasClass('hat-HardHatBlue') === false) {
						//$('.olLayerDiv .olAlphaImg').addClass('hat-HardHatBlue');
						$('.olLayerDiv .olAlphaImg').attr('src', HardHatBlue);
						$('.side-panel-section .rank').addClass('hat-HardHatBlue');
					} else if (UserLevel === 4 && $('.olLayerDiv .olAlphaImg').hasClass('hat-HardHatBrown') === false) {
						//$('.olLayerDiv .olAlphaImg').addClass('hat-HardHatBrown ');
						$('.olLayerDiv .olAlphaImg').attr('src', HardHatBrown);
						$('.side-panel-section .rank').addClass('hat-HardHatBrown');
					} else if (UserLevel === 3 && $('.olLayerDiv .olAlphaImg').hasClass('hat-HardHatOrange') === false) {
						//$('.olLayerDiv .olAlphaImg').attr('src', HardHatOrange);
						$('.olLayerDiv .olAlphaImg').attr('src', HardHatOrange);
						$('.side-panel-section .rank').addClass('hat-HardHatOrange');
					} else if (UserLevel === 2 && $('.olLayerDiv .olAlphaImg').hasClass('hat-HardHatLightBlue') === false) {
						//$('.olLayerDiv .olAlphaImg').addClass('hat-HardHatLightBlue');
						$('.olLayerDiv .olAlphaImg').attr('src', HardHatLightBlue);
						$('.side-panel-section .rank').addClass('hat-HardHatLightBlue');
					} else if (UserLevel === 1 && $('.olLayerDiv .olAlphaImg').hasClass('hat-HardHatGreen') === false) {
						//$('.olLayerDiv .olAlphaImg').addClass('hat-HardHatGreen');
						$('.olLayerDiv .olAlphaImg').attr('src', HardHatGreen);
						$('.side-panel-section .rank').addClass('hat-HardHatGreen');
					}
				}

				//remove the class olAlphaImg this lets the to loaction hard hat be the colored hardhat
				$('.olLayerDiv .olAlphaImg').removeClass('olAlphaImg');

			}
		};
	}

	function LiveUserAdded(u) {
		//console.log("WmeHardHats1 LiveUserAdded " + u);
		//alert(u.attributes.name);
		var i;
		//save the dunce list
		//localStorage.setItem('DunceList', $('#HardHatDunceList').val());

		//conver the textarea into the dunce array
		//var lines = $('#HardHatDunceList').val().split(/\n/);
		var DunceList = [];

		var lines = [];
		if ($('#HardHatDunceList').val()) {
			lines = $('#HardHatDunceList').val().split(/\n/);

			for (i = 0; i < lines.length; i++) {
				// only push this line if it contains a non whitespace character.
				if (/\S/.test(lines[i])) {
					DunceList.push($.trim(lines[i]));
				}
			}

		}
		//$('#HardHatDunceList').hide();

		var usrRank = u.attributes.rank;
		var usrID = u.attributes.id;

		//console.log("WmeHardHats1: " + u.attributes.name.replace(/-/gi, "&#x2011;") + "----" + usrRank);

		if (usrRank === null) {
			window.setTimeout(function() {
				LiveUserAdded(u);
			}, 500);
			//console.log("User not loaded yet. Wait and try later...");
			return;
		} else {
			usrRank++;
			//console.log("WmeHardHats2: " + u.attributes.name.replace(/-/gi, "&#x2011;") + "----" + usrRank);
		}
		//console.log("WmeHardHats3: " + u.attributes.name.replace(/-/gi, "&#x2011;") + "----" + usrRank + "----" + u._events.listeners.moved[0].obj.icon.$div[0].childNodes.length);

		if (u._events.listeners.moved[0].obj.icon.$div[0].childNodes.length < 1) {

			//  return;
		}
		//console.log("WmeHardHats4: " + u.attributes.name.replace(/-/gi, "&#x2011;") + "----" + usrRank);

		//reset var used to determine which hat to use
		var OnDunceList = false;
		var OnSpecialHatsList = false;

		//change dunce hats editors
		for (i = 0; i < DunceList.length; i++) {
			//alert(DunceList[i]);
			if (DunceList[i] === u.attributes.name.replace(/-/gi, "&#x2011;") && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatDunce') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatDunce');
				ShowWMEMessage("HardHats: Dunce list editor is online: " + u.attributes.name, 5000);
				OnDunceList = true;
			}
		}

		if (OnDunceList === false) {
			//change special hats editors
			for (i = 0; i < SpecialHatsList.length; i++) {
				if (SpecialHatsList[i] === u.attributes.name.replace(/-/gi, "&#x2011;") && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-' + SpecialHatsList[i] + '') === false) {
					$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHat' + SpecialHatsList[i] + '');
					OnSpecialHatsList = true;
					//usrRank=0;
				}
			}
		}

		if (OnSpecialHatsList === false && OnDunceList === false) {
			//change to the normal editors hardhat colors
			if (usrRank >= 6 && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatRed') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatRed');

			} else if (usrRank === 5 && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatBlue') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatBlue');

			} else if (usrRank === 4 && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatBrown') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatBrown ');

			} else if (usrRank === 3 && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatOrange') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatOrange');

			} else if (usrRank === 2 && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatLightBlue') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatLightBlue');

			} else if (usrRank === 1 && $(u._events.listeners.moved[0].obj.icon.$div[0]).hasClass('hat-HardHatGreen') === false) {
				$(u._events.listeners.moved[0].obj.icon.$div[0]).addClass('hat-HardHatGreen');
			}
		}

		//$(u._events.listeners.moved[0].obj.icon.$div[0]).append('<div style="position: absolute; left: 20px; pointer-events: none; font-size: 18px; top: -1px; color: white;">'+ usrRank +'</div>');	


		//float the editors rank above their hat
		//$(u._events.listeners.moved[0].obj.icon.$div[0]).append('<div style="position: absolute; left: 25px; pointer-events: none; font-size: 12px; top: 2px; color: white;">'+ usrRank +'</div>');	

		//double float the editors rank above their hat. (make clicking a editor bring them to the top of the pile (Brian Jacobs jbrianj))
		$(u._events.listeners.moved[0].obj.icon.$div[0]).append('<div style="position: absolute; left: 0px; pointer-events: none; font-size: 0px; top: 0px; color:none;">' + usrRank + '</div>').click(function() {
			curZIndex++;
			$(u._events.listeners.moved[0].obj.icon.$div[0]).css('zIndex', curZIndex);
		
			if (FollowUserID == usrID) {
				//alert("HardHats: You are no longer following " + u.attributes.name);
				ShowWMEMessage("HardHats: You are no longer following " + u.attributes.name, 2500);
				FollowUserID = "";
				clearTimeout(HardHatFollow);
			} else {
				//alert("HardHats: You are now following " + u.attributes.name);
				ShowWMEMessage("HardHats: You are now following " + u.attributes.name, 2500);
				FollowUserID = usrID;
				HardHatFollow = window.setInterval(FollowUser, 750);
			}		
			
		});
		
	}


	function FollowUser() {
		if (FollowUserID !== "") {
			for (var i = 0; i < Waze.model.chat.users.models.length; i++) {
				if (Waze.model.chat.users.models[i].attributes.id == FollowUserID) {
					var userCoords = Waze.model.chat.users.models[i].attributes.center;
					//console.log(userCoords);
					var lon = userCoords.lon + 0.005;
					var xy = OpenLayers.Layer.SphericalMercator.forwardMercator(lon, userCoords.lat);
					Waze.map.setCenter(xy);
					break;
				}
			}
		}
	}

